style.css:
@-moz-document domain("agar.io") {
/****************************************************

Thème créer par eXo-Necro pour le jeu Agar.io

/* Game */

#canvas, #debug-overlay{
    -webkit-filter: brightness(60%) contrast(200%); /* Chrome, Safari, Opera */
    filter: brightness(50%) contrast(200%); /* Firefox */
}

/* Ads */

div.agario-promo{
    display:none;
}
div#mainPanel.agario-panel>center{
    display:none;
}

/* Interface */

.agario-panel {
    background-color: #272727;
}
.form-control {
    color: #808080;
    background-color: #1B1B1B;
    border: 1px solid #3A3A3A;
}
body {
    color: #6F6F6F;
}
hr {
    border-top: 1px solid #3A3A3A;
}
.btn-info {
    background-color: #1F7088;
    border-color: #104B5D;
}
.btn-info.active, .btn-info.focus, .btn-info:active, .btn-info:focus, .btn-info:hover, .open>.dropdown-toggle.btn-info {
    color: #fff;
    background-color: #1A4957;
    border-color: #10303A;
}
.btn-success {
    background-color: #326F32;
    border-color: #183E18;
}
.btn-success.active, .btn-success.focus, .btn-success:active, .btn-success:focus, .btn-success:hover, .open>.dropdown-toggle.btn-success {
    background-color: #1E4C1E;
    border-color: #1C441C;
}
.btn-warning {
    color: #fff;
    background-color: #B7761A;
    border-color: #634213;
}
.btn-warning.active, .btn-warning.focus, .btn-warning:active, .btn-warning:focus, .btn-warning:hover, .open>.dropdown-toggle.btn-warning {
    background-color: #52360F;
    border-color: #382409;
}
.agario-wallet-container {
    border: 1px solid #326F32;
}
.agario-wallet-container .agario-wallet-plus {
    background: #326F32;
}
.progress {
    background-color: #989898;
}
.btn-shop, .btn-shop:active, .btn-shop:disabled {
    background-color: #8A4B12;
    border-color: #804613;
}
#openfl-content>canvas{
    -webkit-filter: brightness(80%) contrast(115%);
    filter: brightness(80%) contrast(115%);
}
#statsSubtext,#statsChartText, #statsText {
    color: #969696;
}
.tosBox {
    background-color: #272727;
}
}
